import TxELogo from '../../assets/txeLogo.svg'
import { Icon } from '../../icons/Icons';

const Navbar = () => {
    return ( 
        <div className='flex justify-center items-center space-x-44 p-4'>
            <div>
                <img src={TxELogo} alt="" />
            </div>
            <div>
                <ul className='hidden md:flex space-x-20'>
                    <li>About</li>
                    <li>Achievements</li>
                    <li>Speakers</li>
                    <li>EventSchedule</li>
                </ul>
                {/* small devices */}
                <Icon.BarMenu className='md:hidden' />
            </div>
        </div>
     );
}
 
export default Navbar;
